import React from 'react';
import ReactDOM from 'react-dom';
import ServiceList from "./ServiceList"

const services = [
  { "id" : 38, "name" : "vertx", "url" : "https://vertx.io/", "created_at" : "Wed, 3 Nov 2021 21:12:57 GMT" },
  { "id" : 39, "name" : "medium", "url" : "https://medium.com/", "created_at" : "Thu, 4 Nov 2021 20:54:16 GMT" }
]

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      message: "Hello poller frontend"
    }
  }

  componentDidMount() {
    fetch("/api/services")
      .then(response => response.text())
      .then(text => this.setState({message: text}));
  }

  render() {
      return (
        <div>
            <h1>
              Services
            </h1>
             <div>
                      <ServiceList services={services} />
                    </div>
        </div>

        )
      }

}

